import React from 'react'
import Link from 'next/link'

const NavLink = ({ href, children }) => {
    return (
        <Link href={href}>
            <a>{children}</a>
        </Link>
    )
}

const NavBar = () => {
    return (
        <div className='bg-gray-500 py-4'>
            <Link href='/about'>
                <a>Sobre</a>
            </Link>
            <Link href='/autoregister'>
                <a>Cadastre-se</a>
            </Link>
            <Link href='/access'>
                <a>Entrar</a>
            </Link>
        </div>
    )
}

export default NavBar
